import axios from 'axios';

const baseInstagramUrl = process.env.REACT_APP_BASE_INSTAGRAM_URL;
const consumer_key = process.env.REACT_APP_CONSUMER_KEY;
const consumer_secret = process.env.REACT_APP_CONSUMER_SECRET;

const FetchInstagramLikes = async (setTiktoklikes, setIsLoading, setError) => {
  try {
    const response = await axios.get(
      `${baseInstagramUrl}/wp-json/wc/v3/products?consumer_key=${consumer_key}&consumer_secret=${consumer_secret}`
    );

    const TikTokLikesData = response.data
      .filter(product => product.name === 'Buy Instagram Likes')
      .map(product => product.meta_data)
      .flat(); // flat() используется для объединения массивов meta_data в один

    console.log(TikTokLikesData); // Проверьте, что TikTokLikesData содержит ожидаемые данные

    const result = [];
    let currentOptionSet = {};

    // Проходим по каждому элементу массива
    TikTokLikesData.forEach(item => {
      // Обрабатываем данные с min_qty и discount
      const minQtyMatch =
        item.key &&
        item.key.match(/_alg_wc_wholesale_pricing_level_min_qty_(\d+)/);
      const discountMatch =
        item.key &&
        item.key.match(/_alg_wc_wholesale_pricing_level_discount_(\d+)/);

      if (minQtyMatch) {
        const index = minQtyMatch[1]; // Получаем индекс уровня
        if (!currentOptionSet[index]) {
          currentOptionSet[index] = {};
        }
        currentOptionSet[index].min_qty = item.value; // Сохраняем min_qty для текущего уровня
      }

      if (discountMatch) {
        const index = discountMatch[1]; // Получаем индекс уровня
        if (!currentOptionSet[index]) {
          currentOptionSet[index] = {};
        }
        currentOptionSet[index].discount = item.value; // Сохраняем discount для текущего уровня
      }
    });

    // Переводим результат в массив объектов
    for (const key in currentOptionSet) {
      result.push(currentOptionSet[key]);
    }

    console.log(result); // Выводим результат в консоль
    return result;
  } catch (error) {
    console.error('Error fetching data:', error); // Выводим ошибку в консоль
    setError(true); // Устанавливаем флаг ошибки
  } finally {
    setIsLoading(false); // Устанавливаем состояние загрузки в false после выполнения
  }
};

export default FetchInstagramLikes;
